import React, { Component} from 'react';
import { NavLink } from "react-router-dom";
import { MenuItems } from './components/Menuitems';
import './Navbar.css'

class Navbar extends Component{

  state={ clicked: false}

  handleClick = () =>{
      this.setState({clicked: !this.state.clicked})
  }
  render(){ 
        
    return(
      <>
      <home className="home">
     <div className="home-row">
     <div className="col12 col-auto pad0">
            
            <NavLink className="navbar-brand" to ="/Home">
        <img src="JHT.png" alt="logo" className="i-amphtml-element i-amphtml-layout-fixed i-amphtml-layout-size-defined i-amphtml-built i-amphtml-layout" i-amphtml-layout="fixed" style={{width: '200px', height: '47.39px' , marginLeft:"74px", loaderDelayOffset:'600ms !important'}}/>
      </NavLink>
            <div className="menu-icon" onClick={this.handleClick}>
                 <i className={this.state.clicked ? 'fas fa-times' :  'fas fa-bars'}></i> 

            </div>
            <ul className={this.state.clicked ? 'nav-menu active': 'nav-menu'}>
                {MenuItems.map((item, index) => {
                    return (
                            <li key={index}>
                             <a className={item.cName} href={item.url}>
                            {item.titles}
                        </a> 
                        </li>
                    ) 
                })}

            </ul>
    
        </div>
        </div>
        </home>
</>
            ) 

}}
export default Navbar;
